import React from "react";
import "../styles/team.css";
import T1 from "../resource/t1.jpg"
import T_2 from "../resource/t2.jpg"
import T_3 from "../resource/t3.jpg"
import T_4 from "../resource/t4.jpg"
import Twitter from "../resource/twitter.svg"
import GooglePlus from "../resource/gPlus.svg"
import Facebook from "../resource/fcb.svg"
import {teamContentData} from "../actions/teamAC";
import {connect} from "react-redux"

class Team extends React.Component{


    componentDidMount() {
        this.props.fetchData("http://localhost/backend/team.php");
    }

    render(){
        // let tm =this.props.team.map((team)=>{
        //     return <div>
        //         <div className="imgContent">
        //             <img onClick={()=>console.log(this.props.team)} src={this.props.team.img} alt="T1"/>
        //             <div className="social">
        //                 <img src={Twitter} alt="Twitter"/>
        //                 <img src={GooglePlus} alt="GooglePlus"/>
        //                 <img src={Facebook} alt="Facebook"/>
        //             </div>
        //         </div>
        //         <h3>{}</h3>
        //         <h5>Director</h5>
        //         <h6>Ea mei nostrum imperdiet deterruisset,<br/>
        //             mei ludus efficiendi ei. Sea summo mazim<br/>
        //             ex, ea errem eleifend definitionem vim</h6>
        //     </div>
        // })
    return (
        <div className="teamContent"  id="team">
            <h1>{this.props.team["title"]}</h1>
            <div className="teamContext">
                <hr/>
                <h6>{this.props.team["context"]}</h6>
                <hr/>
            </div>
            <div className="teamList">

                <div>
                    <div className="imgContent">
                        <img onClick={()=>console.log(this.props)} src='' alt="T1"/>
                        <div className="social">
                            <img src={Twitter} alt="Twitter"/>
                            <img src={GooglePlus} alt="GooglePlus"/>
                            <img src={Facebook} alt="Facebook"/>
                        </div>
                    </div>
                    <h3>{}</h3>
                    <h5>Director</h5>
                    <h6>Ea mei nostrum imperdiet deterruisset,<br/>
                        mei ludus efficiendi ei. Sea summo mazim<br/>
                        ex, ea errem eleifend definitionem vim</h6>
                </div>
                <div>
                    <div className="imgContent">
                        <img src={T_2} alt="T2"/>
                        <div className="social">
                            <img src={Twitter} alt="Twitter"/>
                            <img src={GooglePlus} alt="GooglePlus"/>
                            <img src={Facebook} alt="Facebook"/>
                        </div>
                    </div>
                    <h3>Lisa</h3>
                    <h5>CEO</h5>
                    <h6>Ea mei nostrum imperdiet deterruisset,<br/>
                        mei ludus efficiendi ei. Sea summo mazim<br/>
                        ex, ea errem eleifend definitionem vim</h6>
                </div>
                <div>
                    <div className="imgContent">
                        <img src={T_3} alt="T3"/>
                        <div className="social">
                            <img src={Twitter} alt="Twitter"/>
                            <img src={GooglePlus} alt="GooglePlus"/>
                            <img src={Facebook} alt="Facebook"/>
                        </div>
                    </div>
                    <h3>James</h3>
                    <h5>Marketing And Sales</h5>
                    <h6>Ea mei nostrum imperdiet deterruisset,<br/>
                        mei ludus efficiendi ei. Sea summo mazim<br/>
                        ex, ea errem eleifend definitionem vim</h6>
                </div>
                <div>
                    <div className="imgContent">
                        <img src={T_4} alt="T4"/>
                        <div className="social">
                            <img src={Twitter} alt="Twitter"/>
                            <img src={GooglePlus} alt="GooglePlus"/>
                            <img src={Facebook} alt="Facebook"/>
                        </div>
                    </div>
                    <h3>Jane</h3>
                    <h5>Chief Designer</h5>
                    <h6>Ea mei nostrum imperdiet deterruisset,<br/>
                        mei ludus efficiendi ei. Sea summo mazim<br/>
                        ex, ea errem eleifend definitionem vim</h6>
                </div>
            </div>
        </div>
    )}
}
const mapStateToProps = state => ({
    team: state.team
});

const mapDispatchToProps = dispatch => ({
    fetchData: url => dispatch(teamContentData(url))
});
export default connect(mapStateToProps, mapDispatchToProps)(Team)
